import styled from 'styled-components';

const StyledButton = styled.button`
  font-size: 17px;
  text-transform: uppercase;
  margin: 5px;
  padding: 8px 14px;
  cursor: ${props => {if (props.diabledValue && props.inputTime) return 'pointer';}};
`;

const Button = ({ value, disabledValue, inputTime, onClick }) => {

    return (
        <StyledButton disabled={inputTime ? disabledValue : true} onClick={e => onClick(value)}>
            {value}
        </StyledButton>
    );
  };

  export default Button;
